INSERT INTO `SK_RISK_HD` VALUES ('176813199', 'SJ-17-FXD-00003', NULL, '安全科', '172914.0', NULL, 'SJ-17-01', '211321199005117013', NULL, '白冬旭', '安环组', NULL, '风险点:研山-研山厂区-采矿二作业区-采矿场-边坡。风险因素:边坡台阶管理-未对边界上设置的警示标志或围栏进行检查。', NULL, NULL, '露天矿边界应设可靠的围栏或醒目的警示标志，防止无关人员误入。加强日常检查，及时补设、修复破损的警示牌、围栏', '04', '露天矿边界应设可靠的围栏或醒目的警示标志，防止无关人员误入。加强日常检查，及时补设、修复破损的警示牌、围栏', '2021-06-27 00:00:00', '1', NULL, NULL, NULL, '司家营');
