INSERT INTO `SK_RISK_HD` VALUES ('176813584', 'SJ-16-FXD-00015', NULL, '采矿一作业区', '169239.0', NULL, 'SJ-16-01', '130230199006100619', NULL, '李梦龙', '安全室', NULL, '风险点:司家营-司家营矿区-采矿一作业区-采矿场-边坡。风险因素:边坡台阶管理-边坡垮塌。', NULL, NULL, '边坡管理领导小组成员每周组织一次采场边坡专项检查。日常由主管安全生产的副作业长组织检查，也可由组长安排其他成员进行检查，每次检查参加人员不得少于2人；安全室、技术组、生产班组、外委班组定期对采场各边帮进行巡查，保存影像记录及文字记录；每次降雨、降雪等极端天气后或季节交替时，领导小组成员要组织对采场边坡进行全面检查；每次爆破作业后，生产班组、外委班组要对临近爆破位置的边坡进行检查', '02', '边坡管理领导小组成员每周组织一次采场边坡专项检查。日常由主管安全生产的副作业长组织检查，也可由组长安排其他成员进行检查，每次检查参加人员不得少于2人；安全室、技术组、生产班组、外委班组定期对采场各边帮进行巡查，保存影像记录及文字记录；每次降雨、降雪等极端天气后或季节交替时，领导小组成员要组织对采场边坡进行全面检查；每次爆破作业后，生产班组、外委班组要对临近爆破位置的边坡进行检查', '2021-06-27 00:00:00', '1', NULL, NULL, NULL, '司家营');
